import './dashboard.css';

const Dashboard = (props) => {
    return (
        <form>
            <div className="form-row"><label>Token Address: {props.tokenAddress}</label></div>
            <div className="form-row btn-row"><input type="button" value="Get Token" className="btn"/></div>
        </form>
    );
}
